import React from 'react'
import '../deleteBtn/deleteBtn.scss'
import close from '../../img/close.svg'
const DeleteBtn = () => {
  return (
    <div className="product__contols">
        <button className="product__contols-btn"  type="button"><img src={close} alt=""/></button>
    </div>
  )
}

export default DeleteBtn
